  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains case counts, rates,
  and confidence intervals of unintentional carbon monoxide poisoning (CO) inpatient
  hospitalizations and emergency department (ED) visits among California residents.
  Inpatient hospitalization data are aggregated into 5-year groupings for years 2000-2007.
  ED visit data are annual for years 2005-2007. Types of CO poisonings are broken
  out by fire-related, non-fire-related, and unknown cause. The data are stratified
  by county, year, and fire-relatedness.\",\n\t\"license_title\": null,\n\t\"extras\":
